llm_output:
function transfer(address recipient, uint256 amount) public returns (bool) {
    address sender = msg.sender;

    // Ensure trading is active
    require(tradingActive, "ERC20: Trading is not active.");

    // Check if the sender has enough balance
    uint256 senderBalance = _balances[sender];
    require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");

    // Check if the recipient is not the zero address
    require(recipient != address(0), "ERC20: transfer to the zero address");

    // Check if the transfer amount does not exceed the max transaction amount
    if (sender != owner() && recipient != owner()) {
        require(amount <= maxTransactionAmount, "ERC20: Transfer amount exceeds the maxTransactionAmount.");
    }

    // Update balances
    _balances[sender] -= amount;
    _balances[recipient] += amount;

    // Emit the transfer event
    emit Transfer(sender, recipient, amount);

    return true;
}

